import { Container, Nav, Navbar } from 'react-bootstrap'
import CameraOutlinedIcon from '@mui/icons-material/CameraOutlined';
import style from './NavbarComponent.module.css'
import { NavLink } from 'react-router-dom';


export const NavbarComponent = () => {
    return (
        <Navbar className={style.app_navbar} bg="dark" variant="dark">
            <Container className={style.app_navbar_content}>
                <h4 style={{ color: '#fff' }}>
                    <CameraOutlinedIcon className={style.app_icon} /> {' '}Photo Booth
                </h4>
                <Nav>
                    {/* <Nav.Link href="#home"><NavLink to="/profile">Profile</NavLink></Nav.Link>
                    <Nav.Link href="#messages">Сообщения</Nav.Link>
                    <Nav.Link href="#friends">Друзья</Nav.Link>
                    <Nav.Link href="#login">Войти</Nav.Link> */}
                </Nav>

            </Container>
        </Navbar>
    )
}
